// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {Initializable} from "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import {OwnableUpgradeable} from "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import {UUPSUpgradeable} from "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import {IERC20} from "@openzeppelin/contracts/interfaces/IERC20.sol";
import "./interfaces/IEntry.sol";
import "./interfaces/IFund.sol";

contract Entry is Initializable, OwnableUpgradeable, UUPSUpgradeable, IEntry {
    address[] public funds;
    mapping(address => uint) private indexOf;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(address initialOwner) public initializer {
        __Ownable_init(initialOwner);
        __UUPSUpgradeable_init();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function fundsLength() external view returns (uint) {
        return funds.length;
    }

    function createFund(
        bytes calldata code
    ) external onlyOwner returns (uint index, address fund) {
        assembly {
            fund := create(0, code.offset, code.length)
        }
        index = funds.length;
        indexOf[fund] = index;
        funds.push(fund);

        emit FundCreated(index, fund);
    }

    function registerFund(address fund, bytes calldata data) external returns (uint index) {
        require(fund != address(0), "invaild fund address");
        if (funds.length > 0) {
            require(
                indexOf[fund] == 0 && funds[0] != fund,
                "exist fund address"
            );
        }
        IFund(fund).initialize(address(this), data);
        index = funds.length;
        indexOf[fund] = index;
        funds.push(fund);

        emit FundCreated(index, fund);
    }

    function getFundProperty(
        address fund
    ) external view returns (IFund.Property memory property) {
        return IFund(fund).getProperty();
    }

    function getFundAccount(
        address fund,
        address owner
    ) external view returns (uint value, uint shares) {
        return IFund(fund).getAccount(owner);
    }

    function getFundProfit(
        address fund,
        address owner
    ) external view returns (uint profit) {
        return IFund(fund).getProfit(owner);
    }

    function buyFund(
        address fund,
        address to,
        address token,
        uint amount,
        bytes memory data
    ) external returns (uint shares) {
        IERC20(token).transferFrom(msg.sender, fund, amount);
        shares = IFund(fund).mint(to, data);
    }

    function buyFund(
        address fund,
        address to,
        bytes memory data
    ) external payable returns (uint shares) {
        shares = IFund(fund).mint{value: msg.value}(to, data);
    }

    function redeemFund(
        address fund,
        address to,
        uint shares,
        bytes memory data
    ) external returns (uint amount) {
        return IFund(fund).burn(msg.sender, to, shares, data);
    }

    function claimFundProfit(
        address fund,
        address to,
        bytes memory data
    ) external returns (uint amount) {
        return IFund(fund).claimProfit(msg.sender, to, data);
    }

    function updateFundValue(
        address fund
    ) external onlyOwner returns (uint netValue) {
        return IFund(fund).updateValue();
    }

    function swapETH(
        address user,
        address token,
        uint amount,
        uint outAmount,
        bytes calldata signature
    ) external onlyOwner {
        // todo: check user signature
        IERC20(token).transferFrom(user, address(this), amount);
        payable(user).transfer(outAmount);
    }
}

contracts/FundETH.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./interfaces/IEntry.sol";
import "./interfaces/IFund.sol";

contract FundETH is ERC20("Test Fund", "TF"), IFund {
    Property private property;

    uint lastBalance;
    mapping(address => uint) lastNetValue;


    function initialize(address entry, bytes memory data) external{
        require(property.entry==address(0),"fund already initialized!");
        property.token = EthToken;
        property.entry = entry;
    }

    function getProperty() external view returns (Property memory) {
        Property memory result = property;
        result.shares = totalSupply();
        result.netValue = result.value / result.shares;
        return result;
    }

    function getAccount(
        address owner
    ) external view returns (uint value, uint shares) {
        shares = balanceOf(owner);
        value = (shares * property.value) / totalSupply();
    }

    function getProfit(address owner) public view returns (uint profit) {
        return
            balanceOf(owner) *
            (property.value / totalSupply() - lastNetValue[owner]);
    }

    function mint(
        address to,
        bytes calldata data
    ) external payable returns (uint shares) {
        uint balance = address(this).balance;
        if (totalSupply() == 0) {
            property.value = balance;
            shares = property.value * 10000;
        } else {
            uint dValue = balance - lastBalance;
            shares = (dValue * totalSupply()) / property.value;
            property.value += (shares * property.value) / totalSupply();
        }
        lastBalance = balance;
        _mint(to, shares);
    }

    function burn(
        address owner,
        address to,
        uint shares,
        bytes calldata data
    ) external returns (uint amount) {
        amount = (shares * property.value) / totalSupply();
        lastBalance -= amount;
        _burn(owner, shares);
        payable(to).transfer(amount);
    }

    function claimProfit(
        address owner,
        address to,
        bytes memory data
    ) external returns (uint amount) {
        amount = getProfit(owner);
        payable(to).transfer(amount);
    }

    function updateValue() external returns (uint value) {}
}

contracts/interfaces/IEntry.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import "./IFund.sol";

interface IEntry {
    // 基金创建事件
    event FundCreated(uint indexed index, address indexed fund);

    // 查询指定索引的基金地址
    function funds(uint index) external view returns (address);

    // 查询基金总数
    function fundsLength() external view returns (uint);

    // 使用基金合约字节码创建基金
    function createFund(
        bytes calldata code
    ) external returns (uint index, address fund);

    // 使用基金地址注册
    function registerFund(
        address fund,
        bytes calldata data
    ) external returns (uint index);

    // 查询基金属性
    function getFundProperty(
        address fund
    ) external view returns (IFund.Property memory property);

    // 查询指定账户的基金价值(按购买的代币计算)和份额
    function getFundAccount(
        address fund,
        address owner
    ) external view returns (uint value, uint shares);

    // 查询自购买后获得的累计收益（减去已领取部分）
    function getFundProfit(
        address fund,
        address owner
    ) external view returns (uint profit);

    // 使用指定数量的代币购买指定基金给指定用户，返回购买的基金份额
    function buyFund(
        address fund,
        address to,
        address token,
        uint amount,
        bytes memory data
    ) external returns (uint shares);

    // 使用指定数量的ETH购买指定基金给指定用户，返回购买的基金份额
    function buyFund(
        address fund,
        address to,
        bytes memory data
    ) external payable returns (uint shares);

    // 赎回指定份额的基金到指定用户，返回代币数量
    function redeemFund(
        address fund,
        address to,
        uint shares,
        bytes memory data
    ) external returns (uint amount);

    // 领取基金当前累计收益，返回代币数量
    function claimFundProfit(
        address fund,
        address to,
        bytes memory data
    ) external returns (uint amount);

    // 更新基金总价值，应该由后端服务定时调用
    function updateFundValue(address fund) external returns (uint netValue);

    // 使用用户签名批准花费指定代币兑换ETH（前端签发一笔代币approve交易和批准兑换ETH的签名）
    // 如果前端报价太低，后端有权拒绝，后端会预先发送少部分ETH给用户，让approve交易可以成交，要覆盖这个成本
    function swapETH(
        address user,
        address token,
        uint amount,
        uint outAmount,
        bytes calldata signature
    ) external;
}

contracts/interfaces/IFund.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {IERC20} from "@openzeppelin/contracts/interfaces/IERC20.sol";

// 原生代币占位表示
address constant EthToken = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;

interface IFund is IERC20 {
    // 基金铸造（购买）事件
    event Mint(address to, uint shares, uint value);
    // 基金销毁（赎回）事件
    event Burn(address owner, uint shares, uint value);
    // 基金总价值更新事件
    event ValueUpdated(uint value, uint oldValue);

    // 基金属性
    struct Property {
        address token; // 支付或赎回的代币，如果值为EthToken，则表示原生代币
        uint value; // 基金总价值
        uint shares; // 基金总份额，用户购买时增加，赎回时减少
        uint netValue; // 基金净值 = 基金总价值/基金总份额，有收益时增加
        address entry; // 入口合约地址
        address provider; // 供给合约地址，提供收益的合约
        // uint feeRate; // 买入卖出手续费率
    }

    // 初始化基金，注册基金的时候，入口合约进行调用
    function initialize(address entry, bytes memory data) external;

    // 查询基金属性
    function getProperty() external view returns (Property memory property);

    // 查询指定账户的基金价值(按购买的代币计算)和份额
    function getAccount(
        address owner
    ) external view returns (uint value, uint shares);

    // 查询自购买后获得的累计收益（减去已领取部分）
    function getProfit(address owner) external view returns (uint profit);

    // 铸造基金给指定用户，返回份额数量，代币需要提前转给合约
    function mint(
        address to,
        bytes calldata data
    ) external payable returns (uint shares);

    // 销毁指定账户的基金份额，返回代币数量
    function burn(
        address owner,
        address to,
        uint shares,
        bytes calldata data
    ) external returns (uint amount);

    // 领取基金当前累计收益，返回代币数量
    function claimProfit(
        address owner,
        address to,
        bytes memory data
    ) external returns (uint amount);

    // 更新基金总价值
    function updateValue() external returns (uint value);
}

